import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input field by its placeholder text and fill it
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill('iPhone');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate the search button and click it
    // There are multiple buttons with class 'search-btn', so we select the first one.
    const searchButton = page.locator('.search-btn').first();
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_clicked.png'));

    // 3. Extract data to verify the action
    const searchInputValue = await searchInput.inputValue();

    return {
      success: true,
      action: "Searched for 'iPhone' products",
      extractedData: {
        searchQuery: searchInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
